import { buildSchema } from "graphql";

const schema = buildSchema(`
  type Product  {
    id: ID
    name: String
    description: String
    price: Float
    soldOut: Boolean
    inventory: Int
    stores: [Store]!
  }

  type Store {
    store: String
  }

  type Query {
    getProduct(id: ID): Product
    getAllProducts: [Product]
  }  

